import  PostService  from  './PostService';

const  postService  =  new  PostService();

class  UploadPost  extends  Component {

constructor(props) {
    super(props);

}

componentDidMount() {
}
render() {

  return (

      <div class="container-contact100" >
    		<div class="wrap-contact100" style={{margin: '50px'},{backgroundColor:'#eeeeee'}}>
    			<div class="contact100-form-title" style={{backgroundColor:'#dddddd'}}>
    				<span>Make a difference.</span>
    			</div>

    			<form action="home.html" method="POST"  class="contact100-form validate-form">
    				<div class="wrap-input100 validate-input">
    					<input id="name" class="input100" type="text" name="title" placeholder="Title" />
    					<span class="focus-input100"></span>
    					<label class="label-input100" for="name">
    						<span class="lnr lnr-user m-b-2"></span>
    					</label>
    				</div>





    				<div class="wrap-input100 validate-input">
    					<textarea id="message" class="input100" name="body" placeholder="Description"></textarea>
    					<span class="focus-input100"></span>
    					<label class="label-input100 rs1" for="message">
    						<span class="lnr lnr-bubble"></span>
    					</label>
    				</div>


    <button class="contact100-form-btn" id='docs'>
       Upload docs
    </button>

    				<div class="container-contact100-form-btn">

    					<button type='submit' class="contact100-form-btn">
    						 Post
    					</button>
    				</div>


    			</form>
    		</div>
    	</div>
         );
  }
}
export  default  UploadPost;
